import React from 'react';

const ProjectList = ({ projects, onUpdateProject, onDeleteProject, token }) => {
  const handleUpdate = (projectId) => {
    const projectData = prompt('Enter new project data in JSON format');
    try {
      const parsedData = JSON.parse(projectData);
      onUpdateProject(projectId, parsedData);
    } catch (error) {
      alert('Invalid JSON format');
    }
  };

  return (
    <div>
      <h3>Project List</h3>
      <ul>
        {projects.map(project => (
          <li key={project.id}>
            {project.name} - {project.description}
            <button onClick={() => handleUpdate(project.id)}>Update</button>
            <button onClick={() => onDeleteProject(project.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ProjectList;
